webpackJsonp([0x660e9fc7eba0],{343:function(e,a){e.exports={data:{markdownRemark:{html:'<p><img src="/static/BlankSpaceGames.jpg"></p>\n<p>Blank Space Games is a small mobile game development studio formed from a group of UBC students.\nAll of the games have been deployed to the Google Play Store.</p>\n<p><a href="https://play.google.com/store/apps/details?id=ca.BlankSpace.OrangeCube">Orange Cube</a> is a runner game, where you tap to change directions and try to keep on the ever changing pathway.\nTurning perfectly increases your cube\'s size and awards bonus points.\nAs the game speeds up, avoid becoming too small or falling off the edge.</p>\n<p><a href="https://play.google.com/store/apps/details?id=ca.BlankSpace.ThisSideUp">This Side Up</a> is a platformer game, where you play as a cat and the floor is lava.\nCharge your jumps, beat the global high score, and try out all the different cats (there are rumours that a dog can be unlocked too).</p>\n<p><a href="https://play.google.com/store/apps/details?id=ca.BlankSpace.PixelSwitch">Pixel Switch</a> is a reflex game, where you switch between poses to fit through the matching walls segments.\nDon\'t crash into the walls as the speed of the game ramps up.</p>\n<p><strong>Link:</strong><br>\nOur Google Play Store page can be found here: <a href="https://play.google.com/store/apps/dev?id=8000049823133248302">Blank Space Studio</a></p>\n<p><strong>Work:</strong><br>\nThe games were written using C# and Unity 3D Engine.\nI took on varied roles for the games such as the soundtrack, QA testing, and minor feature implementation.</p>\n<p>Screenshots:<br>\n<img src="/static/OrangeCube.png"></p>\n<p><img src="/static/ThisSideUp.png"></p>\n<p><img src="/static/PixelSwitch.png"></p>',frontmatter:{date:"July 30, 2016",path:"/BlankSpaceGames",title:"Blank Space Games",image:"/static/BlankSpaceGames.jpg"}}},pathContext:{}}}});
